import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import './CreateSell.css';
import axios from 'axios';
import ContractContent from './ContractContent'; // Импортираме новия компонент

const CreateSell = () => {
    const { id } = useParams();

    const [formData, setFormData] = useState({
        id: id,
        contractNumber: '',
        purchaserFirstName: '',
        purchaserLastName: '',
        discount: '',
        brokerFirstName: '',
        brokerLastName: '',
        brokerProfit: '',
        entrance: '',
        floor: '',
        apartment: '',
        undergroundFloor: '',
        garage: '',
        parkingPlace: '',
        paymentSchemaId: ''
    });
    
    const [paymentSchemas, setPaymentSchemas] = useState([]); 
    const [success, setSuccess] = useState(null);
    
    useEffect(() => {
        const fetchPaymentSchemas = async () => {
            try {
                const response = await axios.get('http://localhost:8080/payment-schema');
                setPaymentSchemas(response.data);
            } catch (error) {
                console.error('Error fetching payment schemas:', error);
            }
        };
        fetchPaymentSchemas();
    }, [id]);

    const handleFileChange = (e) => {
        const filePath = e.target.files[0].name;
        console.log('Selected file path:', filePath);
    };

    const handleFileClick = () => {
        document.getElementById('fileInput').click();
    };

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log('Form Data:', formData);
        // Тук ще използваш данните за подаване на заявка
    };

    return (
        <div className="create-sell-container">
            <h1>Create Sell</h1>

            <form onSubmit={handleSubmit}>
                {/* Използваме ContractContent като подкомпонент */}
                <ContractContent 
                    formData={formData}
                    handleInputChange={handleInputChange}
                    handleFileClick={handleFileClick}
                    handleFileChange={handleFileChange}
                    success={success}
                />



<ObjectsPriceContent 
                    formData={formData}
                    handleInputChange={handleInputChange}
                    handleFileClick={handleFileClick}
                    handleFileChange={handleFileChange}
                    success={success}
                />

                <div className="contract-purchaser-broker-container">
                <div className="contract-container">
                        {success && <div className="alert alert-success">{success}</div>}
                        
                        <div className="form-group">
                            <label htmlFor="paymentSchema">Payment Schema</label>
                            <select
                                className="form-control"
                                id="paymentSchema"
                                name="paymentSchemaId"
                                value={formData.paymentSchemaId}
                                onChange={handleInputChange}
                            >
                                <option value="">Select a payment schema</option>
                                {paymentSchemas.map(schema => (
                                    <option key={schema.id} value={schema.id}>
                                        {schema.title}
                                    </option>
                                ))}
                            </select>
                        </div>

                        </div>
                    {}
                    <div className="purchaser-container">
                       <label htmlFor="purchaserFirstName">Installments and Dates</label>
                        <div className="form-group">
                        
                            <input
                                type="text"
                                className="form-control no-spinner"
                                id="purchaserLastName"
                                placeholder="€"

                            />
                        </div>
                        <div className="form-group">
                
                            <input
                                type="text"
                                className="form-control no-spinner"
                                id="discount"
                                placeholder="€"
                            />
                        </div>
                    </div>



                    
                    <div className="broker-container">
                        
                    </div>
                </div>

                

                <button type="submit" className="btn btn-outline-primary mt-3">
                    Create Sell
                </button>
            </form>
        </div>
    );
};

export default CreateSell;
